First, we note that $z$ is a root of the equation
\[z^2 - \frac{1 + \sqrt{5}}{2} z + 1 = 0.\]Then by the quadratic formula,
\[z = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\frac{1 + 2 \sqrt{5} + 5}{4} - 4}}{2} = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\frac{-1 + 2 \sqrt{5}}{4}}}{2}.\]Let
\[\alpha = \frac{1 + \sqrt{5}}{4}.\]Then
\[z = \alpha \pm i \sqrt{1 - \alpha^2}.\]Note that
\begin{align*}
\alpha^2 + (1 - \alpha^2) &= \alpha^2 + 1 - \alpha^2 \\
&= 1.
\end{align*}Thus, $\alpha$ and $1 - \alpha^2$ are the coordinates of a point on the unit circle.  Therefore, $z$ is a point on the unit circle rotated by an angle of $\arcsin \sqrt{1 - \alpha^2}$ from the positive $x$-axis.

