Thus, $z$ is a 12th root of unity.  We can check that
\[z = \frac{\frac{1 + \sqrt{5}}{4} + i \sqrt{\frac{-1 + 2 \sqrt{5}}{4}}}{1}\]is a 12th root of unity.  Therefore, $z^{12} = 1.$  Then
\[z^{85} = z^{12 \cdot 7 + 1} = z.\]Therefore,
\[z^{85} + \frac{1}{z^{85}} = z + \frac{1}{z} = \boxed{\frac{1 + \sqrt{5}}{2}}.\]

