$3x + 2y = 12$를 $y$를 solve \begin{align*}
3x + 2y &= 12\\
2y &= 12 - 3x\\
y &= 6 - \frac{3}{2}x
\end{align*} $y$ 의 $4$ 을 $6 - \frac{3}{2}x$   SUBSTITUTE  $4$  for $x$ and solve: \begin{align*}
y &= 6 - \frac{3}{2}x\\
&= 6 - \frac{3}{2}(4)\\
&= 6 - 6\\
&= \boxed{0}
\end{align*}

$0<t<23$이고 $t+2$가 $t$의 모듈로 $23$의 역수인 유일한 $\textbf{홀수}$ 정수 $t$를 찾으시오.

\begin{align*}
(t+2)t&\equiv 1\pmod{23}\\
\Rightarrow\qquad t^2+2t-1&\equiv 0\pmod{23}\\
\Rightarrow\qquad t^2+2t+1&\equiv 2\pmod{23}\\
\Rightarrow\qquad (t+1)^2&\equiv 2\pmod{23}
\end{align*}

$2$의 제곱근은 $10$과 $13$이므로, $t+1\equiv 10\pmod{23}$ 또는 $t+1\equiv 13\pmod{23}$.

\begin{align*}
t+1&\equiv 10\pmod{23}\\
\Rightarrow\qquad t&\equiv 9\pmod{23}
\end{align*}

\begin{align*}
t+1&\equiv 13\pmod{23}\\
\Rightarrow\qquad t&\equiv 12\pmod{23}
\end{align*}

