 draws a rectangle with two semicircles on two adjacent sides. The perimeter of the figure is 400 meters. What is the maximum area of the rectangle in square meters?

[asy]
draw((0,0)--(40,0)--(40,20)--(0,20)--cycle);
draw((0,20)..(20,0)--(20,40)..cycle);
draw((20,0)..(40,20)--(0,20)..cycle);
[/asy]  Let the rectangle have dimensions $x$ and $y$.  The perimeter of the figure is $2x + 2y + \pi x = 400$, so $y = 200 - x - \frac{\pi x}{2}$.  The area of the rectangle is $xy = x(200 - x - \frac{\pi x}{2}) = 200x - x^2 - \frac{\pi x^2}{2}$.  Completing the square, we get \[200x - x^2 - \frac{\pi x^2}{2} = 10000 - \left( x + \frac{\pi x}{2} \right)^2 + \frac{\pi^2 x^2}{4} = 10000 - \left( x + \frac{\pi x}{2} \right)^2 + \frac{\pi^2 x^2}{4}.\]The maximum value of this expression is $10000$, which occurs when $x = 0$.  However, this is not a valid solution, since the rectangle must have positive dimensions.  The maximum value of the expression is therefore slightly less than $10000$.  The maximum area of the rectangle is therefore $\boxed{9999}$ square meters.

